import React from 'react';
import './App.css';

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/questions")
    .then((res) => res.json())
    .then((data) => document.getElementById("questionpanel").innerHTML = `${data[0].question}`)
    .then((data => document.getElementById("answerpanelA").innerHTML = `${data[0].correct}`))
  })
  return (
    <div className="App">
      <div>
        <p id="questionpanel">
        </p>
        </div>
        <div>
          <p id="answerpanelA">

          </p>
        </div>
    </div>
  );
}

export default App;
